import React from "react";
import Radio from "../../../components/radio/Radio";
import Nav from "../../../components/nav/Nav";


const Field=()=>{


    return(
        <div className="container-box">
            <Radio id="computerScience" name="field" value="computerScience" label="Maths & Computer Science"/>
            <Radio id="socialScience" name="field" value="socialScience" label="Social Sciences" />
            <Radio id="business" name="field" value="business" label="Business & Management"/>
            <Radio id="fineArts" name="field" value="fineArts" label="Fine & Applied Arts"/>
            <Radio id="education" name="field" value="computerScience" label="Education" />
            <Nav pageName="home"/>
        </div>
    )
}

export default Field;
